.... but looking at the works of 'artist Renato Guttuso, my thought can not' go to the most 'solar, generous and volcanic my friend Marta Marzotto, muse of the teacher he loved, beloved A lot a lot a lot a lot ! The photos posted are related on his last visit to Sicily: he wanted to visit the Via del Sale in Marsala ... you could not say no to it, it was so charismatic! ...... a special greeting goes to his beloved children @paolamarzotto , @matteomarzotto , @ottomarz !
